    void AddRange(int begin, int end)
    {
        for (int i = begin; i <= end; i++)
        {
            Range.Add(i);
        }
    }
    public void AddString(string str)
    {
        foreach (var i in str)
        {
            Range.Add(i);
        }
    }
    public void AddLatinBasic()
